mapper.select:

select 

from PMSADM.ABA_PS_PROV_PARAM_SEQ
where CMD = #{cmd,jdbcType=VARCHAR}
  and NE_ID = #{neId,jdbcType=VARCHAR}
  and FTR_CD = #{ftrCd,jdbcType=VARCHAR}
  and REQ_RSP_IND = #{reqRspInd,jdbcType=VARCHAR}
  and PARAM_ID = #{paramId,jdbcType=VARCHAR}

mapper.delete:

delete from PMSADM.ABA_PS_PROV_PARAM_SEQ
where CMD = #{cmd,jdbcType=VARCHAR}
  and NE_ID = #{neId,jdbcType=VARCHAR}
  and FTR_CD = #{ftrCd,jdbcType=VARCHAR}
  and REQ_RSP_IND = #{reqRspInd,jdbcType=VARCHAR}
  and PARAM_ID = #{paramId,jdbcType=VARCHAR}
